import { Col, Container, Row } from "react-bootstrap";

import PortraitCard from "../cards/PortraitCard";

const Home = () => {
    return (
        <Container className='customContainer'>
            <img style={{width:"40%"}}  src="art.jpg" alt="" />
            <div>
                <h3>Hi! Welcome to my portfolio.</h3>
                <p><span>Ella Mae Lumibao</span> is a Portraitist. Learnt 
                art from the online world.</p>

            </div>
        </Container>
    );
}

export default Home
